function Biosection () {

return (


    <div className="container">
        <div className="row">

        <div className="col-md-12 text-center biomarg">

       <img className="fickypic" src= {dope} alt="dope">






       </img>







        </div>






        </div>




    </div>









)








}


export default Biosection
